import React from 'react';
import './file.css'
import dirLogo from '../../../../assets/img/dir.svg'
import fileLogo from '../../../../assets/img/file.svg'
import { useDispatch } from 'react-redux';
import { setDir } from '../../../../reducers/fileReducer';

const File = (files) => {
    const dispatch = useDispatch()

    function openHandler() {
        dispatch(setDir(file.__id))
    }

    return (
        <div className='file' onClick={() => openHandler()}>
            <img src={files.file.type === 'dir' ? dirLogo : fileLogo} alt="" className='file__img'/>
            <div className="file__name">{files.file.name}</div>
            <div className="file__date">{files.file.date.slice(0, 10)}</div>
            <div className="file__size">{files.file.size}</div>
        </div>
    );
};

export default File;
